import React from "react";

function FeedbackForm(){
    return(
        <div className="card">
            <h3>How would you rate your service with us?</h3>
            <form>
                <div className="input-group">
                <input type='text' placeholder="write a review"/>

                </div>
            </form>
        </div>
    )
}
export default FeedbackForm
